export default function Projects() {
  return <ProjectPreview src="" alt="" />;
}

function ProjectPreview({
  projectImage,
  projectAlt,
  projectDescription,
  projectName,
}) {
  return (
    <div>
      <img src={projectImage} alt={projectAlt} />
      <h2>{projectName}</h2>
      <p>{projectDescription}</p>
    </div>
  );
}
